import { createBrowserRouter, RouterProvider } from 'react-router-dom'
import HomePage from './pages/HomePage';
import { EditEventPage } from './pages/EditEventPage';
import { RootLayout } from './pages/root';
import { EventDetailPage, loader as eventDetailLoader } from './pages/EventDetailPage';
import  EventsPage, {loader} from './pages/EventsPage'
import { action as actionNewEvent, NewEventPage } from './pages/NewEventPage'
import ErrorPage from './pages/Error';
import EventRootLayout from './pages/EventsRoot';


const route = createBrowserRouter([
  {
    path: '/',
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      { index: true, element: <HomePage /> },
      {
        path: 'events', element: <EventRootLayout />,
        children: [
          {
            index: true,
            element: <EventsPage />,
            loader: loader
          },
          {
            path: ':eventId',
            id: 'event-detail',
            loader: eventDetailLoader,
            children: [
              {
                index: true,
                element: <EventDetailPage />,
              },
              {
                path: 'edit',
                element: <EditEventPage />
              },
            ]
          },

          { path: 'new', 
          element: <NewEventPage />, 
          action: actionNewEvent},
        ]
      },

    ]
  }
])


function App() {
  return <RouterProvider router={route}><div>Home</div></RouterProvider>;
}

export default App;
